    return (
        <section className="gallery-section-wrapper"> {/* Optional wrapper class for overall section styling */}
    <Container>
        <Row>
            <Col lg="12" className="text-center"> {/* Center align titles */}
                <Subtitle subtitle={"Gallery"} />
                <h2 className="gallery__title">Check out our Tour Gallery</h2>
            </Col>
        </Row>
        <Row>
            <Col lg="12">
                <MasonryImageGallery />
            </Col>
        </Row>
    </Container>
</section>
    );
};

export default MasonryImagesGallery;
